step_Avg_Case_Duration_Daily.query:
q = load "${App.Datasets.ServiceSocialPost_tp.FullyQualifiedName}";
q = group q by ('Posted_Year', 'Posted_Month', 'Posted_Day');
q = foreach q generate 'Posted_Year' + "~~~" + 'Posted_Month' + "~~~" + 'Posted_Day' as 'Posted_Year~~~Posted_Month~~~Posted_Day', avg('Case_DurationCalculatedField') as 'avg_Case_DurationCalculatedField';
q = order q by 'Posted_Year~~~Posted_Month~~~Posted_Day' asc;
q = limit q 2000;

Avg_volume_Agent_cou_1.query:
a = load "${App.Datasets.ServiceSocialPost_tp.FullyQualifiedName}";
a = group a by ('Posted_Year','Posted_Month','Posted_Day','Posted_Hour');
a = foreach a generate 'Posted_Year'+"~~~"+'Posted_Month'+"~~~"+'Posted_Day' as 'each_date', 'Posted_Hour' as 'Posted_Hour', count() as 'date_hour_volume', unique('Case_OwnerId') as 'date_hour_agents_working';
a= group a by 'Posted_Hour';
a = foreach a generate 'Posted_Hour' as 'Posted_Hour', round(sum('date_hour_volume')/unique('each_date'),0) as 'Request Volume', round(sum('date_hour_agents_working')/unique('each_date'),0) as '# Agents Working';
a = order a by ('Posted_Hour' asc);

agent_performance_Sc_1.query:
q = load "${App.Datasets.ServiceSocialPost_tp.FullyQualifiedName}";
q = filter q by 'Case_Owner_Name' != "Social Customer Service";
q_C = filter q by 'IsOutbound' == "true";
q_D = filter q by 'Reply_Is_FirstReply' == "true";
result = group q by 'Case_Owner_Name' full, q_C by 'Case_Owner_Name' full, q_D by 'Case_Owner_Name';
result = foreach result generate coalesce(q.'Case_Owner_Name', q_C.'Case_Owner_Name', q_D.'Case_Owner_Name') as 'Case_Owner_Name', count(q) as 'A', avg(q.'Case_DurationCalculatedField') as 'B', avg(q_C.'Reply_First_Response_Time') as 'C', avg(q_D.'Reply_First_Response_Time') as 'D';
result = {{cell(static_measure.selection,0, "saql").asString()}};
result = order result by ('Case_Owner_Name' asc);
result = limit result 2000;
